import Head from 'next/head';
import Layout from '../components/Layout';


const Index = (props) => {
  return (
    <Layout>
      <Head>
        <title>Next.js Proyect - HOME</title>
      </Head>
      <h1>Next</h1>
    </Layout>
  );
};

export default Index;
